import react from "react";
import { useEffect, useState } from "react";
import axios from 'axios'
import './login.css'
import {useNavigate} from 'react-router-dom'
import {useSelector,useDispatch} from 'react-redux'
import { myAppointment } from "../../Reducer/PatientAppointment";

// import store from './store';



export default function Display(){

    const [appointment ,setAppointment] = useState([])
    
    const dispatch = useDispatch()

    const navigate=useNavigate()


    const state = useSelector((state)=>{

    return{
        Mylist:state.PatientAppointment.patientPage,
    }})

    useEffect(()=>{

        axios.get('http://localhost:8080/appointment')
        .then((res)=>{
          console.log(res.data)
          setAppointment(res.data)
        })
        },[])


        const ADD=(item)=>{
          alert('S')
          dispatch(myAppointment(item))
          // navigate('/MyAppointment')
        }

        
    return(
        <>
        <div className='myBigcontainer'>
   
   {console.log(state.Mylist)}

   {appointment.map((get)=>{
      
      return <div className='card'>

        <h3>{get.Clinic}</h3>
        <h4>{get.day}</h4>
        <h6>{get.time}</h6>
        
        <button className='ADDbtn'
        onClick={()=>{ADD(get)}}>
           Add</button>


       </div>
})}

     </div>
        </>
    )
}
